import random
import timeit
import sys
import numpy as np
sys.setrecursionlimit(1500)
N = 10000


array_ = [random.randint(-100, 99) for _ in range(N)]
#array_ = [i for i in range(100)]
numpylist = np.array(array_)

#Сортировка пузырьковым методом
def bubble_sort(our_arr, direction = 'up'):
    a = our_arr
    for k in range(len(a) - 1, 0, -1):
        cnt = 0
        for i in range(k):
            if direction == 'up':
                if a[i] > a[i + 1]:
                    cnt += 1
                    temp = a[i]
                    a[i] = a[i + 1]
                    a[i + 1] = temp

            elif direction == 'down':
                if a[i] < a[i + 1]:
                    cnt += 1
                    temp = a[i]
                    a[i] = a[i + 1]
                    a[i + 1] = temp
            # print(a)
        if cnt == 0:
            break
        # print(a)


#Сортировка выбором
def select_sort(array):
    for i in range(len(array)):
        ind_min = i
        for j in range(i + 1, len(array)):
            if array[j] < array[ind_min]:
                ind_min = j
        array[i], array[ind_min] = array[ind_min], array[i]


#Сортировка вставками
def insert_sort(array):
    for i in range(1, len(array)):
        tmp = array[i]
        j = i - 1
        while tmp < array[j] and j >= 0:
            array[j + 1] = array[j]
            j -= 1
        array[j + 1] = tmp


#Быстрая сортировка
def quick_sort(array):
    if len(array) == 1 or len(array) == 0:
        return array
    else:
        pivot = array[0]
        i = 0
        for j in range(len(array) - 1):
            if array[j + 1] < pivot:
                array[j + 1], array[i + 1] = array[i + 1], array[j + 1]
                i += 1
        array[0], array[i] = array[i], array[0]
        first_part = quick_sort(array[:i])
        second_part = quick_sort(array[i + 1:])
        first_part.append(array[i])
        return first_part + second_part


#Сортировка слиянием
def merge_sort(array):
    if len(array) == 1 or len(array) == 0:
        return array
    else:
        array1 = merge_sort(array[:len(array) // 2])
        array2 = merge_sort(array[len(array) // 2:])
        array3 = []
        i, j = 0, 0
        for k in range(len(array1) + len(array2)):
            if i > len(array1) - 1:
                array3.append(array2[j])
                j += 1
            elif j > len(array2) - 1:
                array3.append(array1[i])
                i += 1
            elif array1[i] > array2[j]:
                array3.append(array2[j])
                j += 1
            elif array1[i] <= array2[j]:
                array3.append(array1[i])
                i += 1
        return array3



def standart_sort(our_arr):
    our_arr.sort(reverse=False)


def numpy_quicksort(our_arr):
    our_arr.sort(kind='quicksort', order=None)


def numpy_heapsort(our_arr):
    our_arr.sort(kind='heapsort', order=None)

